import{_ as e,o as a,c as i,O as t}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 15.2-3821 Qualification of officers; vacancies.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/15.2-3821.md","filePath":"vacode/15.2-3821.md"}'),o={name:"vacode/15.2-3821.md"},c=t('<h1 id="§-15-2-3821-qualification-of-officers-vacancies" tabindex="-1">§ 15.2-3821 Qualification of officers; vacancies. <a class="header-anchor" href="#§-15-2-3821-qualification-of-officers-vacancies" aria-label="Permalink to &quot;§ 15.2-3821 Qualification of officers; vacancies.&quot;">​</a></h1><p>The officers for the election of whom provision is made by § <a href="http://law.lis.virginia.gov/vacode/15.2-3820/" target="_blank" rel="noreferrer">15.2-3820</a> whether elected at the first election for such officers held in the city or at any subsequent election held pursuant to § <a href="http://law.lis.virginia.gov/vacode/24.2-217/" target="_blank" rel="noreferrer">24.2-217</a> or § <a href="http://law.lis.virginia.gov/vacode/24.2-222/" target="_blank" rel="noreferrer">24.2-222</a> shall qualify before the circuit court having jurisdiction in the city or before the clerk of such court in the clerk&#39;s office. In the case of a vacancy in any such office the office shall be filled by appointment by the court, pending the next ensuing general election or, if the vacancy occurs within 120 days prior to such election, pending the second ensuing general election.</p><p>Code 1950, § 15-92; 1962, c. 623, § 15.1-992; 1971, Ex. Sess., c. 158; 1997, c. 587.</p>',3),r=[c];function n(s,f,l,h,d,_){return a(),i("div",null,r)}const v=e(o,[["render",n]]);export{p as __pageData,v as default};
